import React from 'react';
import ISLogo from "/Users/rick/Git/EcoTrackFront-End/ecotrack-frontend/src/img/infosyslogo.png";
import { makeStyles } from '@mui/styles';

const footerStyle = makeStyles({
    footer: {
        display: 'absolute',
        position: 'absolute',
        marginBottom: '0px',
        left: '100px',
        width: '320px',
        height: '100%',
        backgroundColor: '#F1F2ED'
    }
})

export default function footer() {
    const classes = footerStyle();
  return (
    <div className={classes.footerStyle}>   
        <img src={ISLogo} alt='infoysys'/>
    </div>

  )
}
